import './App.css';
import React from 'react'; 

import { Route,Routes ,} from 'react-router-dom';
import Add from './Add';
import Home from './home';
import Edit from './Edit';
const Get=({data})=>{
return({data});
}

function App() {
  return (

      <Routes>
        <Route path='/' element={<Home/>}/>
        <Route path="/Add" element={<Add/>}/>
        <Route path='/Edit' element={<Edit data={Get}/>}/>
      </Routes>


  );
}

export default App;
